description:
From Ararat to Zion

Travel Documentary hosted by Aidan Quinn, published by Vem Media in 2010 - English narration


Information
------------------------------

A documentary about the role and destiny of small nations in the history of humanity. The documentary pays tribute to the millions of Armenian pilgrims who, with a deep devotion and willingness to sacrifice, contributed significantly in preserving the spiritual traditions and legacy of the Holy Land.

